import React from 'react';
import Link from 'next/link'

const Footer = () => {
  return (
    <div className="bg-blue-700 p-4 text-white">
      <div className="container mx-auto text-center">
        Todos os direitos reservados
      </div>
    </div>
  )
}

export default Footer;
